import React, { Component } from 'react'

class MyProgression extends Component{
  render(){
    const { progression } = this.props
    if (progression) {
      return (
        <div className={`myprogression ${progression.color}`}>My Progression</div>
      )
    } else {
      return <div></div>
    }


  }
}

export default MyProgression
